import React, { Component } from 'react';
import classes from './navbar.module.css'

export default class Navbar extends Component {
	render() {
		return (
			<div>
				<nav class>
					<div>
						<h3>product admin</h3>
					</div>
					<ul>
						<li>Dashboard</li>
						<li>Products</li>
						<li>Account</li>
					</ul>
				</nav>
			</div>
		);
	}
}
